('550e8400-e29b-41d4-a716-446655440024', 'SEER', 'colanhuong@gmail.com', 'Nữ', 'Cô Lê Anh Hương', 'Chuyên gia Phong Thủy và Ngũ Hành với 10 năm kinh nghiệm. Tư vấn phong thủy nhà ở, văn phòng và chọn ngày tốt.', '1990-05-15 14:20:00.000', '2025-03-25 11:10:00.000', '2025-11-03 09:45:00.000'),
