('550e8400-e29b-41d4-a716-446655440028', 'SEER', 'cothuytrang@gmail.com', 'Nữ', 'Cô Đỗ Thùy Trang', 'Chuyên gia Tarot trẻ tuổi với 6 năm kinh nghiệm. Phong cách tư vấn hiện đại, dễ gần. Đã tư vấn cho hơn 1200 bạn trẻ.', '1995-09-12 13:20:00.000', '2025-05-08 11:30:00.000', '2025-11-02 09:15:00.000'),
