-- Drop existing tables if exists (cascade to remove all dependencies)
DROP TABLE IF EXISTS seer_performance CASCADE;
DROP TABLE IF EXISTS customer_potential CASCADE;
DROP TABLE IF EXISTS seer_speciality CASCADE;
DROP TABLE IF EXISTS "user" CASCADE;
DROP TABLE IF EXISTS knowledge_category CASCADE;

-- ============================================================================
-- CREATE TABLES
-- ============================================================================

-- Knowledge Category Table
CREATE TABLE knowledge_category (
    category_id VARCHAR(36) PRIMARY KEY,
    name VARCHAR(255) NOT NULL,
    description TEXT,
    created_at TIMESTAMP,
    updated_at TIMESTAMP
);

-- User Table (Customers and Seers)
CREATE TABLE "user" (
    user_id VARCHAR(36) PRIMARY KEY,
    role VARCHAR(20) NOT NULL CHECK (role IN ('SEER', 'CUSTOMER')),
    email VARCHAR(255) NOT NULL UNIQUE,
    gender VARCHAR(10),
    full_name VARCHAR(255) NOT NULL,
    profile_description TEXT,
    birth_date TIMESTAMP,
    created_at TIMESTAMP,
    updated_at TIMESTAMP
);

-- Seer Speciality Table (Seer-Category relationship)
CREATE TABLE seer_speciality (
    id VARCHAR(36) PRIMARY KEY,
    seer_id VARCHAR(36) NOT NULL,
    category_id VARCHAR(36) NOT NULL,
    created_at TIMESTAMP,
    updated_at TIMESTAMP,
    FOREIGN KEY (seer_id) REFERENCES "user"(user_id) ON DELETE CASCADE,
    FOREIGN KEY (category_id) REFERENCES knowledge_category(category_id) ON DELETE CASCADE
);

-- Customer Potential Table
CREATE TABLE customer_potential (
    id VARCHAR(36) PRIMARY KEY,
    customer_id VARCHAR(36) NOT NULL,
    month INT NOT NULL CHECK (month BETWEEN 1 AND 12),
    year INT NOT NULL,
    potential_point INT NOT NULL,
    potential_tier INT NOT NULL CHECK (potential_tier BETWEEN 0 AND 3), -- 0: CASUAL, 1: STANDARD, 2: PREMIUM, 3: VIP
    ranking INT NOT NULL,
    total_booking_requests INT NOT NULL DEFAULT 0,
    total_spending NUMERIC(15, 2) NOT NULL DEFAULT 0,
    cancelled_by_customer INT NOT NULL DEFAULT 0,
    created_at TIMESTAMP,
    updated_at TIMESTAMP,
    FOREIGN KEY (customer_id) REFERENCES "user"(user_id) ON DELETE CASCADE,
    UNIQUE (customer_id, month, year)
);

-- Seer Performance Table
CREATE TABLE seer_performance (
    id VARCHAR(36) PRIMARY KEY,
    seer_id VARCHAR(36) NOT NULL,
    month INT NOT NULL CHECK (month BETWEEN 1 AND 12),
    year INT NOT NULL,
    performance_tier INT NOT NULL CHECK (performance_tier BETWEEN 0 AND 3), -- 0: APPRENTICE, 1: PROFESSIONAL, 2: EXPERT, 3: MASTER
    performance_point INT NOT NULL,
    ranking INT NOT NULL,
    total_packages INT NOT NULL DEFAULT 0,
    total_rates INT NOT NULL DEFAULT 0,
    avg_rating NUMERIC(3, 2) NOT NULL DEFAULT 0,
    total_bookings INT NOT NULL DEFAULT 0,
    completed_bookings INT NOT NULL DEFAULT 0,
    cancelled_by_seer INT NOT NULL DEFAULT 0,
    total_revenue NUMERIC(15, 2) NOT NULL DEFAULT 0,
    bonus NUMERIC(15, 2) NOT NULL DEFAULT 0,
    created_at TIMESTAMP,
    updated_at TIMESTAMP,
    FOREIGN KEY (seer_id) REFERENCES "user"(user_id) ON DELETE CASCADE,
    UNIQUE (seer_id, month, year)
);

